import React from 'react';
import { Card, Container, Row, Col } from 'react-bootstrap';
import logo from './user-logo.png'; // Import the logo image
import './TeacherCard.css'; // Import the CSS file

const TeacherCard = () => {
    return (
        <Container>
            <Row className="justify-content-center">
                <Col>
                    <TeacherCardItem />
                </Col>
                <Col>
                    <TeacherCardItem />
                </Col>
                <Col>
                    <TeacherCardItem />
                </Col>
            </Row>
        </Container>
    );
}

const TeacherCardItem = () => {
    return (
        <Card className="teacher-card">
            <img src={logo} className="card-img-top" alt="..." />
            <div className="card-body">
                <h5 className="card-title">Teacher: Daniyal Siddiqui</h5>
                <p className="card-text">Math Department</p>
            </div>
        </Card>
    );
}

export default TeacherCard;
